description:
Marked with a Heart is a clever little spin on a traditional save the date card.  Set the mood for your wedding day by sending these adorably simplistic cards with a fashion forward design!   

Be sure to click through the photos to see the colors offered for this design, and to see the color combos we love!  {Shown in "Blushing Bride" and "Wedded & Minted" Combo!}   

Once your order is received, the designer will be contacting you via email to receive details specific to your save the date card including where to move that little heart!
